import Button from './components/Button';

function App() {

  const [digits, setDigits] = useState(0);

  const numbers = [{
    number: 7, 
    numWord: "seven"
  },
  { number: 8, 
    numWord: "eight"
  },
  { number: 9, 
    numWord: "nine"
  },
  { number: 4, 
    numWord: "four"
  },
  { number: 5, 
    numWord: "five"
  },
  { number: 6, 
    numWord: "six"
  },
  { number: 3, 
    numWord: "three"
  },
  { number: 2, 
    numWord: "two"
  },
  { number: 1, 
    numWord: "one"
  },
  { number: 0,
    numWord: "zero"
  }
];
  const makeButtons = numbers.map(number => (
    console.log(number),
    <Button number={number.number} value={number.numWord} className="number" click={handleClick}/>
  ))

  function handleClick(event) {
    console.log(event.target.value)
  }

  return (
    <div className="App">
      <div className="total" value={digits}>{digits}</div>
      {makeButtons}
    </div>
  );
}

export default App;
